import { Injectable } from "@angular/core";

@Injectable()
export class BaseUrlService{
    private BaseUrl: string = "http://localhost:8082/quiz/";
    private UserBaseUrl: string = "http://localhost:8080/user/";
    private QuizBaseUrl: string = "http://localhost:8082/quiz/";
    getBaseUrl(): string {
        return this.BaseUrl;
    }
    getUserBaseUrl(): string {
        return this.UserBaseUrl;
    }
    getQuizBaseUrl(): string {
        return this.QuizBaseUrl;
    }

}
